import React, {useEffect, useRef, useState} from 'react';
import * as d3 from "d3";








export default function D3Test(props){
    const d3Container = useRef(null);
    useEffect(()=>{
        const width = 300
        const height = 300
        const svg = d3.select(d3Container.current).attr("viewbox",[0, 0, width, height])
        svg.append("circle").attr("cx",150).attr("cy",50).attr("r",50)
    }, [])

    return <svg
        className="d3_test"

        ref={d3Container}
    />
}
